import React, { useState, useEffect } from "react";
import MainLayout from "../layout/MainLayout";
import axios from "axios";
import {
  Box,
  Typography,
  TextField,
  Button,
  MenuItem,
  Paper,
} from "@mui/material";

const CreateTaskPage = () => {
  const [supportTypes, setSupportTypes] = useState([]);
  const [applications, setApplications] = useState([]);
  const [sqiPics, setSqiPics] = useState([]);
  const [form, setForm] = useState({
    title: "",
    supportType: "",
    description: "",
    applicationId: "",
    sqiPicId: "",
  });

  useEffect(() => {
    const fetchData = async () => {
      try {
        const [supportRes, appRes, picRes] = await Promise.all([
          axios.get("http://localhost:4000/api/support-types", {
            headers: { Authorization: `Bearer ${localStorage.getItem("token")}` },
          }),
          axios.get("http://localhost:4000/api/applications", {
            headers: { Authorization: `Bearer ${localStorage.getItem("token")}` },
          }),
          axios.get("http://localhost:4000/api/sqi-pics", {
            headers: { Authorization: `Bearer ${localStorage.getItem("token")}` },
          }),
        ]);

        setSupportTypes(supportRes.data);
        setApplications(appRes.data);
        setSqiPics(picRes.data);
      } catch (err) {
        console.error("âŒ Gagal memuat data dropdown:", err);
      }
    };

    fetchData();
  }, []);

  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    console.log("ðŸ“¤ Data dikirim:", form);
    // Tambahkan POST ke API sesuai kebutuhan
  };

  return (
    <MainLayout>
      <Box
        sx={{
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
          minHeight: "100vh",
          backgroundColor: "transparent", // tidak ada warna latar
        }}
      >
        <Paper
          elevation={3}
          sx={{
            p: 4,
            width: "100%",
            maxWidth: 500,
            borderRadius: 3,
            boxShadow: "0px 4px 10px rgba(0,0,0,0.1)",
          }}
        >
          <Typography
            variant="h6"
            sx={{
              mb: 2,
              textAlign: "center",
              color: "#1976d2",
              fontWeight: "bold",
            }}
          >
            Tambah Task Baru
          </Typography>

          <Box component="form" onSubmit={handleSubmit}>
            <TextField
              fullWidth
              label="Judul Task"
              name="title"
              value={form.title}
              onChange={handleChange}
              margin="normal"
              required
            />

            <TextField
              select
              fullWidth
              label="Bentuk Support"
              name="supportType"
              value={form.supportType}
              onChange={handleChange}
              margin="normal"
              required
            >
              {supportTypes.map((type) => (
                <MenuItem key={type.id} value={type.name}>
                  {type.name}
                </MenuItem>
              ))}
              <MenuItem value="Other">Other</MenuItem>
            </TextField>

            <TextField
              select
              fullWidth
              label="Aplikasi"
              name="applicationId"
              value={form.applicationId}
              onChange={handleChange}
              margin="normal"
              required
            >
              {applications.map((app) => (
                <MenuItem key={app.id} value={app.id}>
                  {app.name}
                </MenuItem>
              ))}
            </TextField>

            <TextField
              fullWidth
              label="Deskripsi"
              name="description"
              value={form.description}
              onChange={handleChange}
              margin="normal"
              multiline
              rows={3}
              required
            />

            <TextField
              select
              fullWidth
              label="PIC SQI"
              name="sqiPicId"
              value={form.sqiPicId}
              onChange={handleChange}
              margin="normal"
              required
            >
              {sqiPics.map((pic) => (
                <MenuItem key={pic.id} value={pic.id}>
                  {pic.name}
                </MenuItem>
              ))}
            </TextField>

            <Button
              type="submit"
              variant="contained"
              fullWidth
              sx={{
                mt: 3,
                backgroundColor: "#1976d2",
                textTransform: "none",
                fontWeight: "bold",
                "&:hover": { backgroundColor: "#1253a4" },
              }}
            >
              Simpan Task
            </Button>
          </Box>
        </Paper>
      </Box>
    </MainLayout>
  );
};

export default CreateTaskPage;
